<p align="justify">
<p>Com  a  proximidade  da  Copa  do Mundo,  o fluxo de pessoas  nas  filas para  compra  de ingressos aumentou  consideravelmente. Como as filas est&atilde;o cada vez maiores, pessoas menos pacientes tendem a desistir  da  compra  de ingressos  e acabam  deixando  as filas, liberando  assim  vaga  para  outras pessoas.  Quando  uma  pessoa deixa a fila, todas  as pessoas que estavam  atr&aacute;s  dela d&atilde;o um passo a frente,  sendo assim nunca  existe um espa&ccedil;o vago entre  duas pessoas.  A fila inicialmente  cont&eacute;m N  pessoas,  cada  uma  com um  identificador  diferente.   Jo&atilde;ozinho  sabe  o estado  inicial dela  e os identificadores   em  ordem  das  pessoas  que  deixaram  a  fila.   Sabendo  que  ap&oacute;s  o estado  inicial nenhuma  pessoa entrou  mais na fila, Jo&atilde;ozinho  deseja saber o estado  final da fila.<br /><br /><strong>Entrada</strong><br />A primeira  linha cont&eacute;m um inteiro  N  representando a quantidade de pessoas inicialmente  na fila. A segunda linha cont&eacute;m N inteiros representando os identificadores  das pessoas na fila. O primeiro identificador  corresponde  ao identificador  da primeira  pessoa na fila. &Eacute; garantido que duas pessoas diferentes n&atilde;o possuem o mesmo identificador.  A terceira  linha cont&eacute;m um inteiro M representando a quantidade de pessoas que deixaram  a fila.  A quarta linha cont&eacute;m  M  inteiros  representando os identificadores  das pessoas que deixaram  a fila, na ordem em que elas sa&iacute;ram.  &Eacute; garantido que um mesmo identificador  n&atilde;o aparece  duas vezes nessa lista.<br /><br /><strong>Sa&iacute;da</strong><br />Seu programa  deve imprimir  uma linha contendo N &minus; M inteiros com os identificadores  das pessoas que permaneceram na fila, em ordem de chegada.<br /><br /><strong>Restri&ccedil;&otilde;es</strong><br />&bull; 1 &le; N &le; 50000<br />&bull; 1 &le; M &le; 50000 e M &lt; N<br />&bull; Cada  identificador  est&aacute; entre  1 e 100000<br /><br /><strong>Exemplos</strong></p>

<p><strong>Entrada</strong><br />8<br />5 100 9 81 70 33 2 1000<br />3<br />9 33 5<br /><br /><strong>Sa&iacute;da</strong><br />100 81 70 2 1000<br /><br /><strong>Entrada</strong><br />4<br />10 9 6 3<br />1<br />3<br /><br /><strong>Sa&iacute;da</strong><br />10 9 6</p>
